import { SET_UNVISITED_MONEY_OUTPUT } from '../types/types';

const setUnvisitedMoneyOutput = payload => ({
    type: SET_UNVISITED_MONEY_OUTPUT,
    payload
});

export default setUnvisitedMoneyOutput;
